📍Satellite images show the Saky airfield after, according to the Russian Ministry of Defense, “munitions were detonated” there

According to preliminary information, in the open areas of the Saky airfield, a few hours before the impact, the following occurred:

▪️Su-30SM – 13 vehicles;
▪️Su-24M/R – 12 vehicles;
▪️IL-76 – 1 vehicle;
▪️Mi-8 helicopters – 8 vehicles.


On the video, presumably, the airfield "Saky" after the "explosion of ammunition".

The video footage was published by Russian Telegram channels, but it is not yet possible to confirm its authenticity.
